import React,  { Component } from 'react';
import './App.css';
import Navbar from './component/Navbar';
import Foot from './component/Foot';
import LoggingButton from './component/LoggingButton';

export default class App extends Component {
  handleClick() {
    scroll(0, 1200);
  }
  toButton() {
    scroll(0, 1500);
  }
  render() {

    return <div>
      <Navbar />
       <div className="header">
        <div className="main">
          <p>众银云测，是一家专注于泛金融领域的信息技术公司，致力深耕人工智能与区块链技术</p>
          <div className="more">
            <div onClick={() => this.handleClick()}>了解详情</div>
            <div className="custom-service" onClick={() => this.toButton() }>资讯客服</div>
          </div>
          <div className="arrow-bottom" onClick={() => this.handleClick()}>

         </div>
        </div>
      </div>
      <div className="product">
        <h1 className="product-title">我们的产品</h1>
        <div className="product-body">
           <div>
             <h2>众银云测APP-最好用的贷款助手</h2>
             <p>众银云测APP，是基于iOS/andriod双平台开发的贷款助手APP，
             为深圳市众银云测信息技术有限公司自主打造的贷款信息分享平台，致
             力于分享优质贷款产品，连接客户与产品方，并通过智能匹配引擎助力
             共享销售，为客户提供专业高效的服务，为产品方获取精准客户。</p>
           </div>
        </div>
      </div>
      <Foot />
    </div>;
  }
}
